import { useState } from "react";
import {Navrouter} from "./Arreglos";
function Manejadores() {

    const [open, setOpen] = useState(false);

    return (

    <div >
      <div className="h-16 w-20 bg-slate-100 hover:bg-slate-500 ">
      <div className="text-3xl"onClick={() => setOpen(!open)}>
            <ion-icon name={`${open ? "close" : "menu"}`}></ion-icon>
          </div>
          <ul
        className={`md:hidden bg-gray-100 fixed w-full top-0 overflow-y-auto bottom-0 py-20 pl-4 duration-500 ${
          open ? "left-0" : "left-[-100%]"
        }`}
      >
        <div>
            <nav className="px-3" >
                {Navrouter.map(([title])=> (
                    <div>
                        <div className="text-left md:cursor-pointer">
                            <a onClick={() => setOpen(!open)} >{title}</a>
                        </div>
                    </div>
                ))}
            </nav>
        </div>
      </ul>
      </div>
      <div className="h-16 w-20 bg-slate-800 hover:bg-slate-500 "></div>
      <div className="h-16 w-20 bg-slate-800 hover:bg-slate-500 "></div>
    </div>
  );
}

export default Manejadores;
